function Card(props) {
    return (
        <>
            <div className={props}>
                <div className='img'>
                    <img src='https://resizing.flixster.com/0xxuABVVuzJrUT130WFHKE-irEg=/ems.cHJkLWVtcy1hc3NldHMvdHZzZWFzb24vNzUyMTFhOTktZTU4Ni00ODkyLWJlYjQtZTgxYTllZmU2OGM0LmpwZw==' alt='image'></img>
                </div>
                <h4>Netflix Original Series</h4>
                <h3>Stranger Things</h3>
                <button>Watch Now</button>
            </div>
        </>
    )
}

export default Card;
